import React from "react"
class Navi extends React.Component{
    render(){
        return(
            <div>
               <ul style={{gridAutoColumns}}>
                <li>Home</li>
                <li>Profile</li>
                <li>About</li>
                <li>Contact</li>
               </ul>

            </div>
        )
    }
    
}
export default Navi;
